import React from "react";
import { audits } from "./data";

function Home() {
  return (
    <main>
      <div className="home-recent">Recent Audits</div>
      <div className="home-unresolved">Unresolved Audits</div>
      <div className="underline"></div>
      <ul>
        {audits.filter((audit) => {
          const { tenantid, tenantName, timeRemaining, resolved, date } = audit;

          return (
            <li>
              <div>tenantName</div>
              {resolved ? (
                <div>resolved</div>
              ) : (
                <div>{timeRemaining} days left</div>
              )}
            </li>
          );
        })}
      </ul>
    </main>
  );
}

export default Home;
